import React from 'react';

const Header = () => {
    return (
      <header className="flex overflow-hidden gap-2.5 items-center self-start py-2 pr-4 pl-5 text-sm font-semibold text-black bg-white">
        <img loading="lazy" src="https://cdn.builder.io/api/v1/image/assets/TEMP/990545d7237b22e812af5b3302fa8f99a029ac311f35406cedacbf486c80e04a?apiKey=41a05d9f32184de6ab741feeca2fc9c4&&apiKey=41a05d9f32184de6ab741feeca2fc9c4" alt="" className="object-contain shrink-0 self-stretch my-auto w-6 aspect-[0.92]" />
        <div className="self-stretch my-auto">
          <span>about_me.txt</span>
        </div>
        <img loading="lazy" src="https://cdn.builder.io/api/v1/image/assets/TEMP/9eec7cddd4b0b5a22192d1b9436ecb7066892dce4a75352c7a1077e21a552fc3?apiKey=41a05d9f32184de6ab741feeca2fc9c4&&apiKey=41a05d9f32184de6ab741feeca2fc9c4" alt="" className="object-contain shrink-0 self-stretch my-auto w-6 aspect-square" />
      </header>
    );
};

const Profile = () => {
    return (
        <div className="flex overflow-hidden flex-col justify-center px-24 py-36 w-full bg-white h-screen max-md:px-5 w-full text-left">
            <section className="text-base font-medium text-sky-500 max-md:max-w-full">
            # Hello there <br />
            </section>
            <div className="flex flex-col text-leftitems-start pt-3.5 pr-16 pb-16 mt-7 max-w-full w-[70%] max-md:pr-5">
                <h1 className="text-7xl font-semibold text-black max-md:max-w-full max-md:text-4xl">
                    Hi, my name is <br></br> Katherine Ye
                </h1>
                <p className="z-10 mt-12 text-xl leading-8 font-[450] text-[color:var(--sds-color-text-default-default)] max-md:mt-10 max-md:max-w-full">
                    I'm a Computer Engineering student at the University of Toronto, dedicated to building innovative integrated solutions and continuously exploring the ever-growing field of technology.
                </p>
                {/*
                <div className="flex items-start mt-0">
                    <div className="flex z-10 shrink-0 mr-0 max-w-full bg-yellow-400 bg-opacity-50 h-[18px] w-[378px]"/>
                    <div className="flex z-10 shrink-0 mt-8 mr-0 max-w-full bg-yellow-400 bg-opacity-50 h-[18px] w-[392px]"/>
                </div>
                */}
            </div>
        </div>
    );
};

const Hero = () => {
  return (
    <div className="flex overflow-hidden flex-col">
      <Header />
      <Profile />
    </div>
  );
};

export default Hero;
